import React, { useState } from "react";

const AddCarListing = () => {
  const [formData, setFormData] = useState({
    name: "",
    engine: "",
    km: "",
    fuel: "",
    color: "",
    desc: "",
    brand: "",
    year: "",
    type: "",
    avgConsumption: "",
    images: [],
  });

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    if (files) {
      setFormData({ ...formData, [name]: files });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = new FormData();
    for (const key in formData) {
      if (key === "images") {
        Array.from(formData.images).forEach((file) => {
          data.append("images", file);
        });
      } else {
        data.append(key, formData[key]);
      }
    }

    fetch("/submit-car", {
      method: "POST",
      body: data,
    })
      .then((res) => res.json())
      .then((result) => {
        alert("Car listing submitted successfully!");
        console.log(result);
      })
      .catch((err) => {
        console.error("Error submitting car:", err);
      });
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Add Car Listing</h2>
      <form onSubmit={handleSubmit} encType="multipart/form-data">
        {[
          ["Listing Name", "name", "text"],
          ["Engine", "engine", "text"],
          ["Kilometers (KM)", "km", "number"],
          ["Fuel Type", "fuel", "text"],
          ["Color", "color", "text"],
          ["Brand", "brand", "text"],
          ["Year", "year", "number"],
          ["Type", "type", "text"],
          ["Average Consumption (L/100km)", "avgConsumption", "number"],
        ].map(([label, name, type]) => (
          <div key={name} style={styles.formGroup}>
            <label htmlFor={name} style={styles.label}>{label}</label>
            <input
              type={type}
              id={name}
              name={name}
              value={formData[name]}
              onChange={handleChange}
              step={type === "number" ? "any" : undefined}
              style={styles.input}
              placeholder={`Enter ${label.toLowerCase()}`}
            />
          </div>
        ))}

        <div style={styles.formGroup}>
          <label htmlFor="desc" style={styles.label}>Description</label>
          <textarea
            id="desc"
            name="desc"
            rows="3"
            value={formData.desc}
            onChange={handleChange}
            style={{ ...styles.input, resize: "vertical" }}
            placeholder="Brief description..."
          />
        </div>

        <div style={styles.formGroup}>
          <label htmlFor="images" style={styles.label}>Upload Images</label>
          <input
            type="file"
            id="images"
            name="images"
            accept="image/*"
            multiple
            onChange={handleChange}
            style={styles.input}
          />
        </div>

        <div style={styles.buttonGroup}>
          <button type="button" style={{ ...styles.button, ...styles.cancel }}>
            Cancel
          </button>
          <button type="submit" style={{ ...styles.button, ...styles.submit }}>
            Add Car
          </button>
        </div>
      </form>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: "800px",
    margin: "50px auto",
    backgroundColor: "#fff",
    padding: "40px",
    borderRadius: "8px",
    boxShadow: "0px 2px 10px rgba(0, 0, 0, 0.1)",
    fontFamily: "Arial, sans-serif",
    background: "#f6f7fb",
  },
  title: {
    color: "#4b2c2c",
    marginBottom: "20px",
  },
  formGroup: {
    display: "flex",
    flexDirection: "column",
    marginBottom: "15px",
  },
  label: {
    marginBottom: "5px",
    fontWeight: "500",
  },
  input: {
    padding: "10px",
    borderRadius: "5px",
    border: "1px solid #ccc",
    fontSize: "14px",
  },
  buttonGroup: {
    marginTop: "20px",
    textAlign: "right",
  },
  button: {
    padding: "10px 20px",
    border: "none",
    borderRadius: "6px",
    fontSize: "14px",
    cursor: "pointer",
  },
  cancel: {
    backgroundColor: "#aaa",
    color: "#fff",
    marginRight: "10px",
  },
  submit: {
    backgroundColor: "#603030",
    color: "#fff",
  },
};

export default AddCarListing;
